import React from 'react';
import props from './Components/props';

const App = () => {
  return (
    <>

      <h1 className="card-text text-center text-danger my-4">Bootstrap cards with props</h1>

      <div className="container">
        <div className="row">
          <div className="col-lg-3 my-3">

            <props />

          </div>
        </div>
      </div>

    </>
  );
};
export default App
